import React from 'react';
import logo from '../Netflix_2015_logo.svg';

const Header = () => {
    return (
        <div className="ui massive text inverted menu">
            <div className="ui container">  
                <div className="item">              
                    <img className="logo-img" src={logo} alt="NETFLIX" />  
                </div>
            </div>
        </div>              

    )
}

export default Header;
